export const collatedTasks = [
  { key: "INBOX", name: "Inbox" },
  { key: "TODAY", name: "Today" },
  { key: "NEXT_7", name: "Next 7 Days" }
];

//FORM LABELS
export const labels = {
  username: "Your name",
  email: "Email",
  password: "Password",
  confirmPassword: "Confirm password",
  terms: "I agree to the Terms of Services and Privacy Policy"
};

//REVIEWS
